import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { FormsModule } from '@angular/forms';
import { HttpClientModule } from '@angular/common/http';

import { OrderDetailsComponent } from './order-details.component';

@NgModule({
  declarations: [
    OrderDetailsComponent // Declares the component in the module
  ],
  imports: [
    BrowserModule,  // Enables running the app in the browser
    FormsModule,    // For template-driven forms
    HttpClientModule // For HTTP services
  ],
  providers: [], // No extra providers, services are injected directly where needed
  bootstrap: [OrderDetailsComponent] // Sets the root component for bootstrapping
})
export class OrderDetailsModule {}
